let defaultState={
    color:"red"
}

const mainReducer=(state=defaultState,action)=>{

    switch(action.type)
    {
        case "CHANGE_HISTORY":
                            return{
                                ...state,
                                history:action.history
                            }                            
        default:
                            return{
                                ...state
                            }
    }
}

export default mainReducer;
